import React, { useState } from "react";
import { X, ThumbsUp, ThumbsDown } from "lucide-react";
import "./AddReview.css";

const issueOptions = [
  "None",
  "Bad odor",
  "No soap",
  "Dim lighting",
  "No water",
  "No cleaning",
  "Wet floor",
  "No toilet paper",
  "Dirty",
  "Broken door",
].sort();

const cleanlinessOptions = ["Pristine", "Clean", "Acceptable", "Unsanitary", "Avoid"];

const AddReview = ({ id, open, onClose }) => {
  const [name, setName] = useState("");
  const [rating, setRating] = useState(0);
  const [cleanliness, setCleanliness] = useState("Clean");
  const [issues, setIssues] = useState([]);
  const [review, setReview] = useState("");
  const [liked, setLiked] = useState(null);

  const handleIssueChange = (issue) => {
    if (issue === "None") {
      setIssues(["None"]);
      return;
    }

    setIssues(prev => {
      // If selecting an issue and "None" was selected, remove "None"
      if (prev.includes("None")) {
        return [issue];
      }

      // Toggle the selected issue
      const newIssues = prev.includes(issue) 
        ? prev.filter(i => i !== issue)
        : [...prev, issue];

      // If no issues are selected, default to "None"
      return newIssues.length === 0 ? ["None"] : newIssues;
    });
  };

  if (!open) return null;

  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <div className="modal-header">
          <h2>Share Your Experience</h2>
          <button className="close-button" onClick={onClose}>
            <X size={24} />
          </button>
        </div>

        <form className="review-form">
          <div className="input-group">
            <label>Name</label>
            <input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="Enter your name"
              className="text-input"
            />
          </div>

          <div className="input-group">
            <label>Rating</label>
            <div className="rating-group">
              {[1, 2, 3, 4, 5].map((value) => (
                <button
                  key={value}
                  type="button"
                  onClick={() => setRating(value)}
                  className={`rating-button ${rating === value ? 'active' : ''}`}
                >
                  {value}
                </button>
              ))}
            </div>
          </div>

          <div className="input-group">
            <label>Cleanliness</label>
            <select
              value={cleanliness}
              onChange={(e) => setCleanliness(e.target.value)}
              className="text-input"
            >
              {cleanlinessOptions.map((option) => (
                <option key={option} value={option}>{option}</option>
              ))}
            </select>
          </div>

          <div className="input-group">
            <label>Issues Encountered</label>
            <div className="issues-grid">
              {issueOptions.map((issue) => (
                <button
                  key={issue}
                  type="button"
                  onClick={() => handleIssueChange(issue)}
                  className={`issue-button ${issues.includes(issue) ? 'active' : ''} ${issue === 'None' ? 'none-issue' : ''}`}
                >
                  {issue}
                </button>
              ))}
            </div>
          </div>

          <div className="input-group">
            <label>Additional Comments</label>
            <textarea
              value={review}
              onChange={(e) => setReview(e.target.value)}
              placeholder="Share your detailed experience..."
              className="review-textarea"
            />
          </div>

          <div className="action-buttons">
            <div className="feedback-buttons">
              <button
                type="button"
                onClick={() => setLiked(true)}
                className={`feedback-button ${liked === true ? 'active like' : ''}`}
              >
                <ThumbsUp size={20} />
                Like
              </button>
              <button
                type="button"
                onClick={() => setLiked(false)}
                className={`feedback-button ${liked === false ? 'active dislike' : ''}`}
              >
                <ThumbsDown size={20} />
                Dislike
              </button>
            </div>
            <button type="submit" className="submit-button">
              Submit Review
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default AddReview;
